import React, { useState, useEffect, useContext } from "react";
import { db } from "../utils/config";
import {
  collection,
  setDoc,
  updateDoc,
  doc,
  arrayUnion,
  arrayRemove,
} from "firebase/firestore";
import { DataContext } from "./DataContext";

function SendTestData() {
  const { userData, userAuthState, siteDate } = useContext(DataContext);
  // const [tradeEntryCount, setTradeEntryCount] = useState("");

  // setTradeEntryCount(Object?.keys(userData?.tradesData)?.length);

  useEffect(() => {
    const testDataSend = async () => {
      let s1 = "Straddle";
      let s2 = "Stragle";
      let entryCount = Object?.keys(userData?.tradesData)?.length + 1;
      let tradeDataTemp = {
        entryCount: 0,
        [entryCount]: {
          date: siteDate.c.day + "-" + siteDate.c.month + "-" + siteDate.c.year,
          noOfStrats: 3,
          [s1]: {
            pnl: 6000,
            detail: {
              noOfTrade: 3,
              trade1: {
                scripName: "Nifty",
                direction: "Long",
                pnl: 2000,
              },
              trade2: {
                scripName: "Nifty",
                direction: "Long",
                pnl: 2000,
              },
              trade3: {
                scripName: "Nifty",
                direction: "Long",
                pnl: 2000,
              },
            },
          },
          [s2]: {
            pnl: 6000,
            detail: {
              noOfTrade: 3,
              trade1: {
                scripName: "Nifty",
                direction: "Long",
                pnl: 2000,
              },
              trade2: {
                scripName: "Nifty",
                direction: "Long",
                pnl: 2000,
              },
              trade3: {
                scripName: "Nifty",
                direction: "Long",
                pnl: 2000,
              },
            },
          },
        },
      };

      console.log(tradeDataTemp);
      // for (let i = 0; i < 5; i++) {
      //   data.push(data[i]);
      // }

      const testingSendingData = doc(db, "users", "devscryptcomp@gmail.com");
      // await updateDoc(testingSendingData, { strategyTags: arrayUnion(data) });
      await setDoc(
        testingSendingData,
        { tradesData: tradeDataTemp },
        { merge: true }
      );
    };
  }, [tradeEntryCount]);
  return (
    <div>
      <button onClick={testDataSend}></button>
    </div>
  );
}

export default SendTestData;
